          </p>
        </div>
      </div>

      <div className="cart-btn">
        {/* <button onClick={handleClick} className="btn">
          Add to cart
        </button> */}
        <button onClick={notify} className="btn">+</button>
      </div>
      <ToastContainer />
    </div>
  );
}

export default FoodBox;
